.heart {
  animation: heartbeat 1s infinite;
  background-color: red;
  display: inline-block;
  height: 10px;
  margin: 0 2px;
  //   position: relative;
  top: 0;
  transform: rotate(-45deg);
  //   position: absolute;
  left: 45%;
  top: 45%;
  width: 10px;
}

.heart:before,
.heart:after {
  content: '';
  background-color: red;
  border-radius: 50%;
  height: 10px;
  position: absolute;
  width: 10px;
}

.heart:before {
  top: -5px;
  left: 0;
}

.heart:after {
  left: 5px;
  top: 0;
}

@keyframes heartbeat {
  0% {
    transform: scale(1) rotate(-45deg);
  }
  20% {
    transform: scale(1.25) rotate(-45deg);
  }
  40% {
    transform: scale(1.5) rotate(-45deg);
  }
}

