 */
@charset 'utf-8';
.tui-pagination * {
  -moz-user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  user-select: none;
}

.tui-ico-ellipsis,
.tui-ico-first,
.tui-ico-last,
.tui-ico-next,
.tui-ico-prev {
  overflow: hidden;
}

.tui-pagination {
  height: 30px;
  margin: 14px 0 12px;
  line-height: normal;
  text-align: center;
  font-size: 0;
}

.tui-pagination .tui-page-btn {
  display: inline-block;
  position: relative;
  width: 30px;
  padding: 8px 0 6px;
  margin-left: 0;
  color: #fff;
  font-size: 12px;
  font-weight: normal;
  line-height: 1;
  text-decoration: none;
  vertical-align: middle;
}

.tui-pagination .tui-page-btn:hover {
  border-width: 1px 0;
  border: 1px solid #dc56c5;
  border-radius: 10px 0px;
  box-sizing: border-box;
}

.tui-pagination .tui-is-selected,
.tui-pagination strong {
  color: #dc56c5;
  cursor: pointer;
  border-width: 1px 0;
  border: 1px solid #dc56c5;
  border-radius: 10px 0px;
  box-sizing: border-box;
}

.tui-pagination .tui-is-selected:hover {
  border-radius: 10px 0px;
}

.tui-pagination .tui-first-child.tui-is-selected,
.tui-pagination strong.tui-first-child {
  margin-left: 0;
}

.tui-pagination .tui-first-child,
.tui-pagination .tui-prev-is-ellip {
}

.tui-pagination .tui-last-child,
.tui-pagination .tui-next-is-ellip {
}

.tui-pagination .tui-first-child.tui-is-selected {
  border-radius: 10px 0px;
}

.tui-pagination .tui-last-child.tui-is-selected {
  border: 1px solid #dc56c5;
  border-radius: 10px 0px;
}

.tui-pagination .tui-first,
.tui-pagination .tui-prev,
.tui-pagination .tui-next,
.tui-pagination .tui-last,
.tui-pagination .tui-prev-is-ellip,
.tui-pagination .tui-next-is-ellip {
  overflow: hidden;
  height: 30px;
  padding: 0;
  font-size: 0;
  line-height: 30px;
  white-space: nowrap;
  font-weight: normal;
}

.tui-pagination .tui-prev-is-ellip {
  border-right: 0;
}

.tui-pagination .tui-next-is-ellip {
  border-left: 0;
}

.tui-pagination .tui-first + .tui-prev,
.tui-pagination .tui-next + .tui-last {
  border-left: 0;
}

.tui-pagination .tui-ico-first,
.tui-pagination .tui-ico-prev,
.tui-pagination .tui-ico-next,
.tui-pagination .tui-ico-last,
.tui-pagination .tui-ico-ellip {
  background: url(data:image/png;base64,)
    no-repeat 0 0;
  display: inline-block;
  vertical-align: middle;
  font-size: 0px;
  box-sizing: border-box;
}

.tui-pagination .tui-prev-is-ellip,
.tui-pagination .tui-next-is-ellip {
  padding: 0;
  line-height: 1;
  box-sizing: border-box;
}

.tui-pagination .tui-prev {
  margin-right: 10px;
  box-sizing: border-box;
}

.tui-pagination .tui-next {
  margin-left: 10px;
  box-sizing: border-box;
}

.tui-pagination .tui-ico-first {
  width: 11px;
  height: 10px;
  background-position: -13px 0px;
  box-sizing: border-box;
}

.tui-pagination .tui-ico-prev {
  width: 6px;
  height: 10px;
  background-position: -26px -12px;
  box-sizing: border-box;
}

.tui-pagination .tui-ico-next {
  width: 6px;
  height: 10px;
  background-position: -21px -24px;
  box-sizing: border-box;
}

.tui-pagination .tui-ico-last {
  width: 11px;
  height: 10px;
  background-position: -13px -12px;
  box-sizing: border-box;
}

.tui-pagination .tui-ico-ellip {
  width: 15px;
  height: 2px;
  margin-top: 16px;
  vertical-align: top;
  background-position: -16px -16px;
  box-sizing: border-box;
}

.tui-page-inputs {
  display: inline-block;
  vertical-align: top;
}

.tui-page-inputs .tui-page-input {
  display: inline-block;
  width: 10px;
  height: 12px;
  padding: 8px 0 6px;
  font-size: 12px;
  text-align: center;
  color: rgb(252, 249, 249);
  border: 0;
  outline: none;
}

.tui-page-inputs .tui-page-current {
  color: #4b96e6;
}

.tui-page-separator {
  display: inline-block;
  font-size: 12px;
  height: 12px;
  padding: 8px 0 6px;
  vertical-align: top;
}

